import React from "react";
import { useState } from "react";

const run = () => {
    let date = new Date();
    let hh = date.getHours();
    let mm = date.getMinutes();
    let ss = date.getSeconds(); 
}
const App = () => {
    let date = new Date();
    let hh = date.getHours();
    let mm = date.getMinutes();
    let ss = date.getSeconds(); 
    const run =()=>{
        console.log('hello')
    }
    return (
        <>
          <h1>{hh}:{mm}:{ss}</h1>
          <button className="btn" onClick={run} >click me!</button>
        </>
           )
}
export default App;
